INSERT INTO `blogs` VALUES (1,1,1,'Review of the Latest Foldable Smartphones','latest-foldable-smartphone-review','A deep dive into the pros and cons of new generation foldable mobile devices.','Detailed performance benchmarks, battery life tests, and camera comparisons for the top foldable phones released this year.','blogs/qFDYpd4LwKVnSEKLdLNd0D4pfo1H1JbYr1I2SLuc.webp','[\"Smartphones\", \"Review\", \"Gadgets\", \"Android\"]','2025-11-15 04:15:00','2025-11-19 10:59:48','2025-11-20 04:04:51'),(2,1,2,'The Importance of Sleep for Muscle Recovery','sleep-muscle-recovery-guide','Understanding the connection between quality sleep and effective physical recovery.','Scientific explanation of REM and non-REM sleep phases and how they impact protein synthesis and growth hormone release.','blogs/3TJbsrmz1z5pYyMIK78IH0vp7I9urMkxhLNzryNW.webp','[\"Sleep\", \"Fitness\", \"Wellness\", \"Recovery\"]','2025-11-16 08:45:00','2025-11-19 10:59:48','2025-11-20 04:05:03'),(4,1,4,'The Perfect Sourdough Bread Starter Recipe','perfect-sourdough-starter','A step-by-step guide to creating and maintaining a healthy sourdough starter from scratch.','Includes troubleshooting common issues like mold and slow rising.','blogs/jaa5x8Z53qFnNnHWUCd40rlYUPRWFdrDTiEj4ALd.webp','[\"Baking\", \"Recipe\", \"Sourdough\", \"Bread\"]','2025-11-18 06:00:00','2025-11-19 10:59:48','2025-11-20 03:36:50'),(5,1,5,'Effective Note-Taking Strategies for College Students','note-taking-strategies-college','Techniques like the Cornell method and mapping to improve retention and study habits.','Focuses on digital vs. physical note-taking tools and their respective advantages.','blogs/qmdEhVSMtzNLUqjMsJGkfJFWu3ZVG9hFw7XJRxbe.webp','[\"Study Tips\", \"Learning\", \"Students\", \"Productivity\"]','2025-11-19 10:15:00','2025-11-19 10:59:48','2025-11-20 03:37:34'),(6,1,6,'5 Ways to Boost Your Small Business SEO','boost-small-business-seo','Practical, low-cost Search Engine Optimization tips for local and online businesses.','Covers Google My Business, keyword research, and improving site speed for better rankings.','blogs/0zP6CFbgDDYismywT2XTWjXjn1Pys9XqpCrS4hmu.webp','[\"Marketing\", \"SEO\", \"Business Growth\", \"Strategy\"]','2025-11-20 07:25:00','2025-11-19 10:59:48','2025-11-20 03:38:27'),(7,1,7,'Declutter Your Digital Life: A Minimalist Approach','declutter-digital-minimalism','How to organize files, manage email subscriptions, and reduce screen time for mental clarity.','Includes steps for digital asset management and creating a distraction-free workspace.','blogs/gwF8W7yEUseJ0vu5DpePXprLs5tNkA1yZQYpaLcW.webp','[\"Minimalism\", \"Habits\", \"Wellness\", \"Productivity\"]','2025-11-21 04:45:00','2025-11-19 10:59:48','2025-11-20 03:39:09'),(8,1,8,'Analysis of the Recent Football Championship Final','football-championship-analysis','A detailed breakdown of the tactics, key player performances, and turning points of the final match.','Focuses on the defensive structure and midfield battles that determined the outcome.','blogs/tJHKjc6ko9opHZnT6thyx8znvrURX3CTM0u0cf2d.webp','[\"Football\", \"Sports Analysis\", \"Tactics\", \"Game Review\"]','2025-11-22 06:15:00','2025-11-19 10:59:48','2025-11-20 03:39:58'),(9,1,9,'The Hidden Meanings in the New Sci-Fi Blockbuster','hidden-meanings-sci-fi-movie','A review and philosophical breakdown of the latest high-budget science fiction film.','Explores the themes of artificial consciousness and environmental decay depicted in the movie.','blogs/2K7svmx1sDSig7O1dDpoxFJ9sN3yMDscXOGSsAmV.webp','[\"Movies\", \"Review\", \"Sci-Fi\", \"Film Theory\"]','2025-11-23 10:00:00','2025-11-19 10:59:48','2025-11-20 03:40:41'),(13,1,2,'How To Build Your Own Workout Routine: Plans, Schedules, and Exercises','fsdfgsdzg-p0tyzJ','After all, a workout should be developed around a person’s training, goals, not to mention things you ENJOY doing!','When it comes to knowing what’s healthy, even qualified experts often seem to hold opposing opinions. This can make it difficult to figure out what you should actually be doing to optimize your health.\r\n\r\nYet, despite all the disagreements, a number of wellness tips are well supported by research.','blogs/AVy4LQKG7vl1vJjs6BtPERZmZ0HWgxdEkyilwHZr.webp','[\"Laravel\", \"Php\"]','2025-11-20 03:46:12','2025-11-20 03:46:12','2025-11-20 04:12:59'),(14,1,1,'The Rise of Quantum Computing in Software Development','the-rise-of-quantum-computing-in-software-development-9YSBDP','Quantum computing is rapidly moving from theoretical physics to practical engineering, promising revolutionary speeds for complex algorithms.','Quantum computing represents a massive paradigm shift in computational power. Unlike classical computers which use bits (0 or 1), quantum computers use qubits, enabling superposition and entanglement. This means they can process a vast number of states simultaneously. Key applications are expected in drug discovery, financial modeling, and materials science. While still in early stages, developers need to familiarize themselves with foundational concepts like quantum gates and simulators. The technology is primarily focused on solving optimization problems that are currently impossible for even the most powerful classical supercomputers. This field is truly the future.','blogs/0NCB4kS2qYAtiESyNk4pXbKWZfDXXcut1UfsDGSG.webp','[\"Quantum\", \"AI\", \"Future Tech\", \"Computing\"]','2025-11-21 00:54:37','2025-11-21 00:54:37','2025-11-21 00:54:37'),(15,1,2,'The Truth About Zone 2 Cardio for Longevity','the-truth-about-zone-2-cardio-for-longevity-T4y2rv','Zone 2 training is a simple yet powerful way to improve mitochondrial function, boost endurance, and support long-term metabolic health.','Zone 2 cardio is performed at a low intensity where you can comfortably hold a conversation. This typically corresponds to about 60-70% of your maximum heart rate. The primary goal is to target slow-twitch muscle fibers, forcing your mitochondria (the powerhouse of your cells) to become more efficient at burning fat for fuel. Regular Zone 2 sessions, ideally three to four times a week for 45 minutes or more, are foundational for serious athletes and essential for anyone prioritizing longevity. It decreases resting heart rate and improves insulin sensitivity, making it a cornerstone of preventative health.','blogs/cN9yBzZOoUwTGrt654iAmhe0h04H3cPFOciMppOE.webp','[\"Cardio\", \"Longevity\", \"Endurance\", \"Mitochondria\"]','2025-11-21 00:56:33','2025-11-21 00:56:33','2025-11-21 00:56:33'),(16,1,1,'The Next Generation of AI Models','next-generation-ai-models','Discussing the shift towards multimodal AI systems and their impact on creative industries and data analysis pipelines.','The release of models like Gemini and others signifies a major leap in artificial intelligence. These new models are inherently multimodal, meaning they can seamlessly process and generate information across text, code, audio, and images. This capability unlocks applications previously restricted to specialized models. For developers, this requires a fundamental change in how prompts are engineered and how data pipelines are structured to utilize these fused capabilities effectively. The focus shifts to integrated intelligence rather than isolated tasks.','blogs/ezQa4EyXn3V1WLBrMNEoZqmdWPRGpW124drK7Pt9.webp','[\"AI\", \"Machine Learning\", \"Future Tech\", \"Gemini\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:20:36'),(17,1,1,'Mastering the Kubernetes Orchestration Layer','mastering-kubernetes-orchestration','A practical guide to understanding Kubernetes Pods, Services, and Deployments, crucial for managing containerized applications at scale.','Kubernetes has become the de facto standard for container orchestration. At its core, it manages three primary resource types: Pods, Deployments, and Services. Pods are the smallest deployable units, encapsulating one or more containers. Deployments define the desired state for a set of replica Pods, ensuring self-healing and scaling. Services abstract the Pods, providing a stable network endpoint for accessing the application. Mastering these concepts is paramount for modern cloud infrastructure engineers aiming for reliability and efficiency.','blogs/c2hYzZBDlolT7rkX0gvm4TuPij1b8RfLpqyLvkeZ.webp','[\"DevOps\", \"Containers\", \"Cloud\", \"K8s\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:20:21'),(18,1,2,'The Science of Cold Exposure and Metabolism','science-cold-exposure-metabolism','Understanding how deliberate exposure to cold temperatures can activate brown fat, boost metabolism, and enhance mood regulation.','Deliberate cold exposure, through cold showers or ice baths, is gaining traction beyond simply being a mental toughness challenge. Scientifically, it primarily works by activating Brown Adipose Tissue (BAT). BAT is metabolically active tissue that burns calories to generate heat, unlike White Adipose Tissue (WAT) which stores energy. Regular cold plunges can increase the overall percentage of BAT, leading to an elevated basal metabolic rate over time. Furthermore, the acute stress response triggers a release of norepinephrine, positively impacting focus and energy levels throughout the day.','blogs/9QtYwP30wmJzTl8Yqjq7VDnfsGqsrNOJY2hqJyFB.webp','[\"Metabolism\", \"Recovery\", \"Wellness\", \"Biohacking\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:08:05'),(19,1,2,'Why Adequate Sleep is Your Most Powerful Recovery Tool','adequate-sleep-recovery-tool','Sleep is not merely a downtime but an active physiological process vital for muscle repair, hormonal balance, and cognitive restoration.','Far too many people view sleep as a luxury rather than a fundamental pillar of health and fitness. During deep non-REM sleep, the body releases Growth Hormone, which is essential for muscle tissue repair and synthesis. Poor sleep quality directly impairs glucose metabolism and throws hunger-regulating hormones like ghrelin and leptin out of balance, often leading to weight gain. Prioritizing 7-9 hours of high-quality sleep nightly is arguably more critical for recovery than any supplement or foam rolling technique.','sleep_cycle.png','[\"Sleep\", \"Recovery\", \"Hormones\", \"Wellness\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 06:46:47'),(20,1,3,'Backpacking Southeast Asia on a Tight Budget','backpacking-se-asia-budget','Essential tips for planning routes, finding cheap hostels, navigating local transport, and enjoying street food without breaking the bank.','Southeast Asia remains one of the most budget-friendly regions for backpackers worldwide. Key to a successful cheap trip is embracing local transportation, such as sleeper trains and buses, over flying. Accommodation should focus on highly-rated hostels that often include free breakfast. Crucially, rely on street food vendors for meals; not only is it incredibly cheap, but it offers the most authentic culinary experience. Allocate a daily budget and track every expense meticulously to ensure your adventure lasts as long as possible.','blogs/G4UfIby1xxkDEVWMRYFZ0NrYFz5NS7DdWROGfCyn.webp','[\"Budget Travel\", \"Asia\", \"Hostel\", \"Backpacking\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:09:31'),(21,1,3,'The Ultimate Guide to Hiking Patagonia\'s W Circuit','guide-hiking-patagonia-w-circuit','Prepare for the challenging W Trek in Torres del Paine National Park, covering gear, campsite reservations, and the best viewpoints.','The W Circuit in Torres del Paine, Chilean Patagonia, is arguably one of the world\'s most iconic multi-day treks. It requires meticulous planning, especially regarding campsite reservations which book out months in advance. Essential gear includes waterproof layers, a high-quality sleeping bag rated for freezing temperatures, and lightweight cooking equipment. The major highlights are the view from the base of the Towers, the immense Grey Glacier, and the French Valley. Hikers should aim for shoulder season (March or November) to avoid peak crowds.','blogs/pD5fGT78T5Pmk9uudC9jIHER01In1bZUXKwUj7Le.webp','[\"Patagonia\", \"Hiking\", \"Chile\", \"Trekking\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:09:41'),(22,1,4,'Five Essential Rules for Baking Sourdough Bread','five-essential-sourdough-rules','Demystify sourdough baking by focusing on hydration, starter activity, proper bulk fermentation techniques, and high-temperature baking.','Sourdough baking relies on balancing four key factors: starter strength, dough hydration, temperature control, and time. Always ensure your starter is active and doubled before mixing the dough. High hydration is key for an open crumb, but makes handling difficult. Bulk fermentation is the most critical stage, where gluten development and air creation occur. Finally, bake at high heat with steam (using a Dutch oven is ideal) to achieve that signature dark crust. Follow these rules for consistent, artisanal loaves every time.','blogs/zu7gQUBYZypjHO6wWiXC0gldaaA8YcivZBNscEgt.webp','[\"Baking\", \"Sourdough\", \"Recipe\", \"Bread\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:10:45'),(23,1,4,'Quick 15-Minute Weeknight Mediterranean Chicken Bowls','quick-mediterranean-chicken-bowls','A fast, balanced recipe featuring lemon-herb chicken, fresh cucumber, tomatoes, olives, and a creamy, homemade tzatziki dressing.','These Mediterranean chicken bowls are a perfect solution for busy weeknights when you need flavor without the fuss. Start by quickly sautéing cubed chicken breast with lemon zest, oregano, and salt. While the chicken cooks, chop fresh parsley, cucumber, and tomatoes. Assemble the bowls over a bed of quinoa or mixed greens. The secret is the tzatziki: mix Greek yogurt with grated cucumber, garlic, and dill. This dish delivers protein, healthy fats, and vibrant vegetables in under fifteen minutes.','blogs/kZf7zwAFpjMl2597Um8MIxttX2nvYgaZD3xyv6Tw.webp','[\"Recipe\", \"Weeknight\", \"Healthy\", \"Mediterranean\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:10:57'),(24,1,5,'How to Master the Feynman Technique for Deep Learning','master-feynman-technique','Use Richard Feynman\'s powerful four-step method—explain, identify gaps, organize, and simplify—to understand complex topics quickly and thoroughly.','The Feynman Technique is a mental model for learning named after the Nobel laureate physicist Richard Feynman. The process begins with selecting a concept and attempting to teach it to a child. This immediately reveals your knowledge gaps. The second step is returning to the source material to reinforce understanding. Third, you organize and simplify your notes. Finally, you reiterate the teaching process until the explanation is simple and clear. This active recall method converts surface-level knowledge into deeply integrated understanding, improving long-term retention dramatically.','blogs/8ju1PZJTCbzwFRuDQDaPUEh08o8norModQYOe4uR.webp','[\"Study Skills\", \"Learning\", \"Productivity\", \"Active Recall\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:12:11'),(25,1,5,'Essential Study Habits for Post-Secondary Success','essential-study-habits-post-secondary','Develop effective time management, use active recall methods like spaced repetition, and structure your environment for optimal focus and productivity.','Transitioning to post-secondary education requires a shift from passive learning to proactive study habits. Time management is crucial; use the Pomodoro Technique to break study periods into focused sprints. Secondly, rely heavily on active recall, such as flashcards or self-quizzing, over simple rereading of notes. Spaced repetition is also vital, scheduling reviews at increasing intervals to combat the forgetting curve. Finally, maintain a dedicated, distraction-free study space that encourages deep work. These habits separate successful students from those who struggle.','blogs/GYWiITIbQgSLjRz6Mppy3HDTOAqetaQTHhK566Oh.webp','[\"Habits\", \"University\", \"Student\", \"Time Management\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:11:57'),(26,1,6,'The Lean Startup Methodology for Small Businesses','lean-startup-for-small-business','Learn how to apply the Build-Measure-Learn feedback loop to validate assumptions, reduce risk, and rapidly iterate your business model.','Eric Ries\'s Lean Startup methodology is not just for tech companies; its principles are applicable to any small business. The core concept is the Build-Measure-Learn feedback loop. First, you build a Minimum Viable Product (MVP). Second, you measure customer responses and data. Third, you learn from the data, which tells you whether to pivot or persevere. This process minimizes waste, allowing the company to validate its riskiest assumptions before investing heavily in production. It promotes rapid iteration and customer-centric development.','blogs/JRbvRw0yMZnCPIrNLsQBZoBwxsttjveXHCHs9J3c.webp','[\"Startup\", \"Entrepreneurship\", \"MVP\", \"Strategy\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:13:19'),(27,1,6,'Financial Modeling Basics: CapEx, OpEx, and Cash Flow','financial-modeling-basics-capex-opex','Differentiate between Capital Expenditure (CapEx) and Operating Expenditure (OpEx) and understand their combined effect on a company\'s cash flow statement.','Understanding basic financial modeling is essential for any business leader. Capital Expenditure (CapEx) represents funds used by a company to acquire, upgrade, and maintain physical assets like property, buildings, or equipment. Operating Expenditure (OpEx), conversely, covers the day-to-day running costs, such as salaries, utilities, and rent. The distinction is critical because CapEx is capitalized and depreciated, while OpEx is expensed immediately. Both types of expenditures ultimately impact the cash flow statement, revealing the true liquidity and financial health of the business.','blogs/eaibzhor2XybHGOFgkGqk6dK42KulI3J6k5CnYsO.webp','[\"Finance\", \"Accounting\", \"Cash Flow\", \"Budgeting\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-12-02 03:29:00'),(29,1,7,'How to Build a Sustainable Morning Routine That Lasts','build-sustainable-morning-routine','Focus on simplicity, consistency, and alignment with personal energy levels to create a morning routine that energizes rather than drains you.','A sustainable morning routine should not be a checklist of tasks borrowed from productivity gurus, but a customized schedule that supports your specific goals. Start small, perhaps with just five minutes of mindful breathing or journaling. Consistency is far more important than intensity. Ensure your routine includes elements that feed your mind (reading), body (movement), and spirit (mediation or reflection). The key is to wake up before your obligations start, giving you proactive control over the first hour of your day, setting a positive tone.','morning_routine.jpg','[\"Routine\", \"Self-Care\", \"Habits\", \"Mindfulness\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 06:46:47'),(30,1,8,'Analyzing the Dominance of Modern F1 Aerodynamics','dominance-of-f1-aerodynamics','A deep dive into the ground effect, wing design, and suspension geometries that give modern Formula 1 cars their incredible cornering speed.','Modern Formula 1 relies heavily on ground effect aerodynamics, which utilizes the underside of the car to generate massive amounts of downforce. This phenomenon essentially sucks the car to the track, allowing for incredible speeds through corners. The front and rear wings are finely tuned to balance drag and downforce. Teams spend hundreds of hours in computational fluid dynamics (CFD) simulations and wind tunnels to optimize every surface. The slightest change in suspension geometry can dramatically alter how the airflow interacts with the car\'s floor, showcasing the razor-thin margins in this high-stakes sport.','f1_aero.webp','[\"F1\", \"Racing\", \"Aerodynamics\", \"Engineering\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 06:46:47'),(31,1,8,'The Biomechanics of a Perfect Golf Swing Rotation','biomechanics-perfect-golf-swing','Focus on proper hip rotation, shoulder turn sequencing, and core engagement to maximize speed and achieve greater consistency in golf.','Achieving a perfect golf swing requires mastering sequential body rotation, a process known as the kinetic chain. The backswing starts with the shoulders, followed by the hips. Crucially, the downswing initiates from the ground up, starting with a powerful rotation of the hips, which pulls the core and finally the arms through. Lack of hip separation often leads to \'casting\' or \'over-the-top\' swings, resulting in slice shots. Proper biomechanics ensure the club face is square at impact, transferring maximum energy efficiently to the ball.','blogs/xsuNqXkWxf9LQBe4aFkZT9VL5ebB9uEnYw3bv8Nh.webp','[\"Golf\", \"Fitness\", \"Biomechanics\", \"Training\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:22:09'),(32,1,9,'The Resurgence of Practical Effects in Blockbuster Cinema','resurgence-practical-effects-cinema','Exploring how top directors are balancing CG visuals with traditional makeup, miniature sets, and animatronics to enhance believability and texture.','While CGI remains essential for large-scale destruction and impossible scenarios, many A-list directors are returning to practical effects. This resurgence is driven by the desire for tangible realism. Practical effects, such as large animatronics or physical explosions, provide better lighting interaction and visual weight than pure digital models. Audiences often unconsciously perceive the difference, feeling more grounded in the story when they know physical objects were filmed on set. The best modern films masterfully blend practical foundation with seamless digital enhancement.','blogs/acdwX6aw5TtEzaiKiT2aOUTk8OLMiV8x2PZU9slW.webp','[\"Film\", \"Movies\", \"Special Effects\", \"Cinema\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:15:58'),(33,1,9,'Analyzing the Lyrical Depth of Modern Hip-Hop Storytelling','lyrical-depth-modern-hip-hop','A study of contemporary hip-hop artists using complex rhyme schemes and narrative structures telling deeply personal and socially relevant stories.','Modern hip-hop storytelling extends far beyond simple boasts; it functions as genuine social commentary and autobiography. Artists employ intricate internal rhyme schemes and shifting perspectives to build complex narratives. The focus has moved toward thematic coherence across entire albums, turning the record into a unified piece of dramatic fiction or non-fiction. This lyrical complexity engages listeners on multiple levels, rewarding deep analysis and repeat listening. This sophistication elevates the genre beyond entertainment, positioning it firmly within literary critique.','blogs/Mfouwq2Okc7Xie6MLrXD12yaAAs2cmzxalemHNe4.webp','[\"Music\", \"HipHop\", \"Culture\", \"Storytelling\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:15:38'),(34,1,10,'Sustainable Fabrics: The Future of High Fashion','sustainable-fabrics-high-fashion','Key designers are adopting recycled materials, innovative bio-based textiles, and transparent supply chains to address fashion\'s massive environmental impact.','The fashion industry faces immense pressure to become sustainable, driving innovation toward new material science. Designers are increasingly using fabrics derived from recycled plastic bottles, old fishing nets, and organic cotton certified by GOTS. More exciting are bio-based textiles, such as those made from mushrooms or fruit waste, offering luxurious alternatives to leather and silk. This shift requires transparency throughout the supply chain, allowing consumers to verify ethical sourcing and production. Sustainability is no longer a niche market but a core driver of modern, high-end fashion trends.','blogs/bL0GIaYGoC8myi14W5ttnr4ILfZzdjjV31tt1ExF.webp','[\"Sustainability\", \"Ethical Fashion\", \"Design\", \"Textiles\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:18:07'),(35,1,10,'Mastering the Art of Capsule Wardrobe Building','mastering-capsule-wardrobe','Create a functional capsule wardrobe by selecting timeless, high-quality, interchangeable core pieces that simplify dressing and reduce consumption.','A capsule wardrobe is a curated collection of essential clothing items that are versatile and interchangeable. The goal is to maximize the number of outfits with the fewest pieces, simplifying daily decisions and promoting sustainable consumption. The process starts by defining a core color palette (e.g., black, white, navy, gray). Next, invest in high-quality basics—a great coat, tailored trousers, and simple knitwear. Avoid fast fashion and choose items with longevity. This minimalist approach saves time, money, and closet space while ensuring you always look polished.','blogs/uZi0rxfkYKJ5Cy4fNndG981cALhxTrOXha08laAc.webp','[\"Wardrobe\", \"Style\", \"Minimalism\", \"Organization\"]','2025-11-21 06:46:47','2025-11-21 06:46:47','2025-11-21 01:18:21'),(36,28,9,'Nisi iure voluptatibus tempora officia minima et necessitatibus.','nisi-iure-voluptatibus-tempora-officia-minima-et-necessitatibus-CYFp0','Expedita optio consequatur officiis maiores autem nisi id. Ad eos harum voluptates sapiente illum reiciendis. Sed praesentium rerum alias ab. Veniam perspiciatis quo dolorem et tempora illo sunt odio.','Illo ullam eos corrupti quam. Ut possimus voluptatem nulla voluptatem ullam quos veritatis. Et ad ipsum nisi omnis et sunt culpa. Quis ea molestiae hic iure. Est omnis a dolor.\n\nEaque qui provident et. Quod iste veritatis omnis consectetur quia ut sint modi. Ipsa omnis sit quia nostrum ut consequuntur possimus.\n\nSint quia et ea similique. Sit illo et voluptate delectus perferendis nihil. Esse repudiandae quis saepe officia veritatis placeat. Est vitae qui porro officia est dolor quod.\n\nAut si